import React, { useState, useEffect } from 'react';
import FormControl from './form_control';
import { Button } from '@material-ui/core';
import Axios from 'axios';

function Form(){
    const [email, setEmail] = useState("");
    const [password, setPassword] = useState("");

    const handleEmail = (e) => {
        setEmail(e.target.value);
    };
    const handlePassword = (e) => {
        setPassword(e.target.value);
    };

    const logIn = () => {
        Axios.post("http://localhost:3001/loggingin", {
            email: email,
            password: password
        }).then((response) => {
            console.log(response);
        });
    }

    return (
        <form>
            <FormControl type="email" label="Email Address" handle={handleEmail}/>
            <br />
            <FormControl type="password" label="Password" handle={handlePassword}/>
            <br />
            <Button variant="contained" color="primary" action={logIn}>Submit</Button>
        </form>
    );
}

export default Form;
